import React from "react";

function Test() {
  return (
    <div>
      <p>
        noun the main body of matter in a manuscript, book, newspaper, etc., as
        distinguished from notes, appendixes, headings, illustrations, etc. the
        original words of an author or speaker, as opposed to a translation,
        paraphrase, commentary, or the like: The newspaper published the whole
        text of the speech. the actual wording of anything written or printed:
        You have not kept to the text of my remarks. SEE MORE verb (used without
        object) Digital Technology. to send a text message: Texting while
        driving is an accident asking to happen. verb (used with object) Digital
        Technology. to send a text message about or containing: He texted
        congratulations to his niece on her new job. Compare instant message
        (def. 2). to send a text message to: The only way I can ever reach her
        is to text her.
      </p>
    </div>
  );
}

export default Test;
